import React, { Component } from "react";
import { withRouter } from "react-router-dom";
import {auth} from "../firebase";
class Dashboard extends Component {
  constructor(props) {
    super(props);
  }

  handleSignout() {
    auth().signOut()
  }

  render() {
    return (
        <div align="center">
            Dashboard
            <button>
              signOut
            </button>
        </div>
    );
  }
}
export default withRouter(Dashboard);
